describe("Timer", () => {
  it("starts when the first cell is clicked", () => {
    return true;
  });

  it("pauses when the game is won.", () => {
    return true;
  });

  it("pauses when the game is lost", () => {
    return true;
  });

  it("resets when the game is reset", () => {
    return true;
  });
});
